import React from 'react';


function Home() {
    return (
        <>
            <div className="container-fluid" id="navbar">
                <div className="my-5 py-5">
                    <div className="mx-auto text-center">
                    <h1 className="my-5">Welcome to Our Shop</h1>
                    <p className="py-3">Here We provide a unique variety of cosmetics to glamour yourself</p>
                </div>
                </div>
            </div>
        </>
    );
}
export default Home;
